import { Link } from 'react-router-dom';

export default class Navbar extends Component {

 

  render() {


    
    return (
      <ul>
        <li ><Link to="/course" className="link">Create Professor</Link>Add Course </li>
        <li><a href="#Mng_students" target="_blank">Manage Students Enrolled</a> </li>
      </ul>

    );
  }
}
